package com.crystalcg.gamedev.util.cache.domain;
/**
 * 联盟特权表
 * @author zhaibiao
 *
 */
public class StaticAlliancePrivilege {
     private String privilegeNo;//权限编号
     private String privilageName;//权限名称
     private int needLevel;//需要等级
     private String positionLimit;//职位限制
	public String getPrivilegeNo() {
		return privilegeNo;
	}
	public void setPrivilegeNo(String privilegeNo) {
		this.privilegeNo = privilegeNo;
	}
	public String getPrivilageName() {
		return privilageName;
	}
	public void setPrivilageName(String privilageName) {
		this.privilageName = privilageName;
	}
	public int getNeedLevel() {
		return needLevel;
	}
	public void setNeedLevel(int needLevel) {
		this.needLevel = needLevel;
	}
	public String getPositionLimit() {
		return positionLimit;
	}
	public void setPositionLimit(String positionLimit) {
		this.positionLimit = positionLimit;
	}
     
     
}
